    const [bin, setBin] = useState(111111111);
    return(
        <AppContext.provider value={{bin, setBin}}>
            <div className='container'>
                <div className='blank'/>
                <div className='blank'/>
                <div className='blank'/>
                <div className='blank'/>
                <DE2Component/>
                <div className='blank'/>
                <div className='blank'><h1>{bin}</h1></div>
                <div className='blank'/>
            </div>
        </AppContext.provider>
    );
};
export default Grid;
